    return jm_is_boolean($val) || json_model_24($val, undef, undef);
}

# object .'$RootSchema'.'&'.0
sub _jm_obj_2($$$)
{
    my ($val, $path, $rep) = @_;
    # check open must/may only props
    if (! jm_is_object($val))
    {
        return 0;
    }
    my $pval;
    my $res;
    if (! exists $$val{'$schema'})
    {
        return 0;
    }
    $pval = $$val{'$schema'};
    # .'$RootSchema'.'&'.0.'$schema'
    return jm_is_string($pval);
}

# check $RootSchema (.'$RootSchema')
sub json_model_26($$$)
{
    my ($val, $path, $rep) = @_;
    # keyword $schema is mandatory at the root, and optional elsewhere
    # .'$RootSchema'
    # .'$RootSchema'.'&'.0
    # .'$RootSchema'.'&'.1
    return _jm_obj_2($val, undef, undef) && json_model_24($val, undef, undef);
}

# check $ (.)
sub json_model_1($$$)
{
    my ($val, $path, $rep) = @_;
    # .
    return json_model_26($val, undef, undef);
}


